import * as React from "react";

function Home() {
  return (
    <div>
      <div class="body">
        <div class="container">
          <h2 style={{ paddingBottom: "8%" }}>Interesting Tagline of TPAT</h2>
          <p>
            Lorem Ipsum is simply dummy text of the printing and typesetting
            industry. Lorem Ipsum has been the industry's standard dummy text
            ever since the 1500s
          </p>
          <a
            style={{
              color: "#57D655",
              border: "#57D655 2px solid",
              marginTop: "4%",
              padding: "10px",
              borderRadius: "12%",
            }}
          >
            Try It Yourself
          </a>
        </div>
      </div>
      <h2
        style={{ display: "flex", justifyContent: "center", paddingTop: "5%" }}
      >
        Service that TPAT provide/categories
      </h2>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: "row",
            width: "90%",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "center",
              //backgroundColor: "red",
              paddingTop: "3%",
              width: "80%",
              alignItems: "center",
            }}
          >
            <div
              style={{
                display: "flex",
                alignItems: "center",
                flexDirection: "column",

                //backgroundColor: "green",
              }}
            >
              <img src="https://wtwp.com/wp-content/uploads/2015/06/placeholder-image.png" />

              <h1 style={{ paddingTop: "5%" }}>Category 1</h1>
              <p style={{ paddingTop: "5%" }}>
                Description on the category 1, or things/services that you
                provide
              </p>
            </div>
          </div>
          <div
            style={{
              display: "flex",
              justifyContent: "center",
              //backgroundColor: "red",
              paddingTop: "3%",
              width: "80%",
              alignItems: "center",
            }}
          >
            <div
              style={{
                display: "flex",
                alignItems: "center",
                flexDirection: "column",

                //backgroundColor: "green",
              }}
            >
              <img src="https://wtwp.com/wp-content/uploads/2015/06/placeholder-image.png" />

              <h1 style={{ paddingTop: "5%" }}>Category 2</h1>
              <p style={{ paddingTop: "5%" }}>
                Description on the category 2, or things/services that you
                provide
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
